import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import Login from './frontend/components/Login';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/frontend" element={<Login/>} />
      </Routes>
    </Router>
  );
}

export default App;
